import React from 'react';

import NavBar from '../UI/NavBar';
import Footer from '../UI/Footer';
import classes from './Shop.module.css';
import Category from './shop/Category';

const Shop = () => {
  return (
    <>
      <NavBar />

      <div className={classes.shop_banner}>
        <header>SHOP</header>
        <p>SHOP</p>
      </div>

      <Category />
      <Footer />
    </>
  );
};

export default Shop;
